    def is_valid_string(parsed_grammar, string):
        """Checks if a string is a valid string according to the grammar."""

        stack = []
        for token in string:
            if token in parsed_grammar.tokens:
                stack.append(token)
            elif token in parsed_grammar.productions:
                if not stack:
                    return False
                top = stack.pop()
                if parsed_grammar.productions[top].startswith(token):
                    stack.append(token)
            else:
                return False

        return not stack

    def parse_grammar(grammar, string):
        """Parses the grammar and returns a dictionary of productions."""
        grammar_dict = {}
        for production in grammar.productions:
            production_dict = {}
            for token in production:
                production_dict[token] = 0
            grammar_dict[production] = production_dict
        return grammar_dict

    grammar = parse_grammar(s, s)

    if is_valid(grammar, s):
        print("Yes")
    else:
        print("No")

